package ua.ksstroy.converter.zonegroup;import ua.ksstroy.converter.Converter;import ua.ksstroy.logic.zonegroup.Measure;import ua.ksstroy.logic.zonegroup.Zone;import ua.ksstroy.logic.zonegroup.ZoneImpl;import ua.ksstroy.models.zone.ZonesModel;public class ZonesModelToZoneConverter implements Converter<ZonesModel, Zone> {    public Zone convert(ZonesModel zonesModel) {        Zone zone = new ZoneImpl();        zone.setId(zonesModel.getId());        zone.setHeight(zonesModel.getHeight());        zone.setName(zonesModel.getName());        zone.setHeight(zonesModel.getHeight());        zone.setWidth(zonesModel.getWidth());        zone.setMeasure(Measure.valueOf(zonesModel.getMeasureName()));        return zone;    }}